import { Route, Router, Switch } from 'react-router';
import './App.css';
import Homepage from "./Page/Homepage"

function App() {
  return (
    <div className="App">
      <Router >
        <Switch>
          <Route exact path="/" component={Homepage} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
